import styled from '@emotion/styled'

const Container = styled.div`
  background-color: white;
  width: 90%;
  margin: 2rem auto;
`

const CartContainer = styled.div`
  display: grid;
  grid-template-columns: 4fr 1fr 1fr 1fr;
`

export const ShoppingCart = () => {
  return (
    <Container>
      <h2>รถเข็นสินค้า (2)</h2>
      <CartContainer>
        <span>สินค้า</span>
        <span>ราคา</span>
        <span>ปริมาณ</span>
        <span>ราคารวม</span>
      </CartContainer>
    </Container>
  )
}
